CREATE ALGORITHM=UNDEFINED DEFINER=`mayab`@`%` SQL SECURITY DEFINER VIEW `reporte_respuestas_evaluacion` AS select `j`.`evaluacion` AS `evaluacion`,`j`.`subordinado` AS `subordinado`,`ef`.`n` AS `empleado_n`,if(isnull(`ev`.`fechaRegistro`),0,1) AS `ev`,`ev`.`evaluador` AS `evaluador`,`ev`.`evaluador_n` AS `ev_evaluador_n`,`ev`.`fechaRegistro` AS `ev_fecha`,if(isnull(`aev`.`fechaRegistro`),0,1) AS `aev`,`aev`.`fechaRegistro` AS `aev_fecha` from (((`jerarquias` `j` join `empleados_formato` `ef` on((`ef`.`empleado` = `j`.`subordinado`))) left join `a1_reporte_respuestas_evaluacion` `ev` on(((`ev`.`empleado` = `j`.`subordinado`) and (`ev`.`evaluacion` = `j`.`evaluacion`)))) left join `respuestas_autoevaluacion` `aev` on(((`aev`.`empleado` = `j`.`subordinado`) and (`aev`.`evaluacion` = `j`.`evaluacion`)))) ;

