CREATE ALGORITHM=UNDEFINED DEFINER=`mayab`@`%` SQL SECURITY DEFINER VIEW `respuestas_autoevaluacion_detalle` AS select `ef`.`empleado` AS `empleado`,`ef`.`n` AS `empleado_nombre`,`ra`.`fechaRegistro` AS `fechaRegistro`,`cc`.`titulo` AS `competencia`,`ccs`.`titulo` AS `seccion`,`ccsc`.`descripcion` AS `pregunta`,`cvp`.`etiqueta` AS `respuesta_etiqueta`,`cvp`.`titulo` AS `respuesta_valor` from (((((((`respuestas_autoevaluacion` `ra` join `respuestas_autoevaluacion_competencias` `rac` on((`rac`.`id_evaluacion_empleado` = `ra`.`id`))) join `cuestionarios_competencias_secciones_conductas` `ccsc` on((`rac`.`id_conducta` = `ccsc`.`id`))) join `cuestionarios_competencias_secciones` `ccs` on((`ccsc`.`seccion` = `ccs`.`id`))) join `cuestionarios_competencias` `cc` on((`ccs`.`competencia` = `cc`.`id`))) join `empleados_formato` `ef` on((`ra`.`empleado` = `ef`.`empleado`))) join `cuestionarios_competencias_secciones_valores_posibles` `ccsvp` on(((`ccsvp`.`competencia` = `cc`.`id`) and (`rac`.`id_valor` = `ccsvp`.`id`)))) join `cuestionarios_valores_posibles` `cvp` on((`ccsvp`.`valor` = `cvp`.`id`))) ;

