INSERT INTO `cartas_templates` VALUES ('1', '<p>Apreciable [empleado_nombre]:</p>\r\n<p>Ha llegado el momento de valorar el desempeño de nuestros colaboradores en la realización de sus <b>funciones</b>  cotidianas, <b>actitudes</b> predominantes y  el grado de desarrollo de sus <b>competencias</b> de acuerdo a sus características personales y las requeridas  para el puesto.</p>\r\n \r\n<p>Es una oportunidad de tener un <b>contacto directo</b> con cada uno y juntos analizar sus fortalezas y áreas de oportunidad a seguir desarrollando en beneficio del área y de acuerdo a nuestra <b>Misión Institucional</b>.</p>\r\n\r\n<p>La evaluación se llevará acabo en las siguientes fechas:</p>\r\n<ul>\r\n	<li>Inicio: <b>Lunes 13 de junio de 2016</b>.</li>\r\n	<li>Cierre: <b>Viernes 24 de junio de 2016 a las 20:00 horas</b>.</li>\r\n	<li>Resultados:\r\n		<ul>\r\n			<li>El <b>lunes 1 y martes 2 de agosto de 2016</b> se enviará a cada <b>Evaluador</b> los resultados vía electrónica.</li>\r\n			<li>Del <b>lunes 29 al miércoles 31 de agosto de 2016</b> se enviará a cada <b>Colaborador</b> sus resultados vía electrónica.</li>\r\n		</ul>\r\n	</li>\r\n</ul>\r\n<p>Recomendaciones:</p>\r\n<ol>\r\n  <li>Una vez iniciada la sesión de evaluación intenta terminarla (no te tomará más de 15 minutos).</li>\r\n  <li>El proceso de evaluación consta de 4 partes, las cuales se deben de contestar al 100%:\r\n		<ol type=\"a\">\r\n			<li><b>Valoración de las Competencias Institucionales:</b> Asistencia y Puntualidad, Actitud de Servicio, Comunicación Asertiva, Compromiso Institucional, Creatividad e Innovación, Proactividad e Identidad Institucional (para todo el personal).</li>\r\n			<li><b>Valoración de las Competencias Directivas:</b> Liderazgo, Toma de Decisiones y Manejo de Estrés (sólo para puestos Directivos).</li>\r\n			<li><b>Valoración de Competencias del Puesto:</b> Las cuales abarcan las funciones generales de cada puesto y algunas especificaciones del nivel.</li>\r\n			<li><b>Redacción libre:</b> Fortalezas, Áreas de Oportunidad, Cursos de Capacitación y Comentarios.</li>\r\n		</ol>\r\n	</li>\r\n	<li>En caso de tener alguna duda, por favor, dirígete al correo <br><a href=\"mailto:evaluacion.desempeno@anahuac.mx\">evaluacion.desempeno@anahuac.mx</a></li>\r\n</ol>\r\n\r\n<p>Finalmente, te invitamos a ingresar al siguiente link desde tu pc o dispositivo móvil, en cualquier lugar que cuente con conexión a internet:<br>\r\n<a href=\"[vinculo]\">[vinculo]</a></p>\r\n<p>\r\n	Muchas gracias por tu interés y colaboración.<br><br>\r\n	Atentamente,<br><br>\r\n	<b>Alejandrina Acevedo Vales.</b>\r\n</p>', '<p>Apreciable [empleado_nombre]:</p>\r\n<p>Ha llegado el momento de  que valores tu desempeño  en la realización de tus <b>funciones</b>  cotidianas, <b>actitudes</b> predominantes y  el grado de desarrollo de tus <b>competencias</b> de acuerdo a tus características personales y las requeridas  para el puesto.</p>\r\n \r\n<p>Es una oportunidad de analizar tus fortalezas y áreas  a seguir desarrollando en beneficio del departamento y de acuerdo a nuestra <b>Misión Institucional</b>.</p>\r\n\r\n<p>La evaluación se llevará acabo en las siguientes fechas:</p>\r\n<ul>\r\n	<li>Inicio: <b>Lunes 13 de junio de 2016</b>.</li>\r\n	<li>Cierre: <b>Viernes 24 de junio de 2016 a las 20:00 horas</b>.</li>\r\n	<li>Resultados:\r\n		<ul>\r\n			<li>El <b>lunes 1 y martes 2 de agosto de 2016</b> se enviará a cada <b>Evaluador</b> los resultados vía electrónica.</li>\r\n			<li>Del <b>lunes 29 al miércoles 31 de agosto de 2016</b> se enviará a cada <b>Colaborador</b> sus resultados vía electrónica.</li>\r\n		</ul>\r\n	</li>\r\n</ul>\r\n<p>Recomendaciones:</p>\r\n<ol>\r\n  <li>Una vez iniciada la sesión de evaluación intenta terminarla (no te tomará más de 15 minutos).</li>\r\n  <li>El proceso de evaluación consta de 3 partes, las cuales se deben de contestar al 100%:\r\n		<ol type=\"a\">\r\n			<li><b>Valoración de las Competencias Institucionales:</b> Asistencia y Puntualidad, Actitud de Servicio, Comunicación Asertiva, Compromiso Institucional, Creatividad e Innovación, Proactividad e Identidad Institucional (para todo el personal).</li>\r\n			<li><b>Valoración de las Competencias Directivas:</b> Liderazgo, Toma de Decisiones y Manejo de Estrés (sólo para puestos directivos).</li>\r\n			<li><b>Valoración de Funciones del Puesto:</b> Las cuales abarcan las funciones generales de cada puesto y algunas especificaciones del nivel.</li>\r\n		</ol>\r\n	</li>\r\n	<li>En caso de tener alguna duda, por favor, dirígete al correo <br><a href=\"mailto:evaluacion.desempeno@anahuac.mx\">evaluacion.desempeno@anahuac.mx</a></li>\r\n</ol>\r\n\r\n<p>Finalmente, te invitamos a ingresar al siguiente link desde tu pc o dispositivo móvil, en cualquier lugar que cuente con conexión a internet:<br>\r\n<a href=\"[vinculo]\">[vinculo]</a></p>\r\n<p>\r\n	Muchas gracias por tu interés y colaboración.<br><br>\r\n	Atentamente,<br><br>\r\n	<b>Alejandrina Acevedo Vales.</b>\r\n</p>');
